import React from 'react';
import './_Footer.scss';
import { FontAwesomeIcon } from '@fortawesome/react-fontawesome';
import { library } from '@fortawesome/fontawesome-svg-core';
import { fab } from '@fortawesome/free-brands-svg-icons';
import { faPhoneAlt } from "@fortawesome/free-solid-svg-icons";

library.add(fab);

const Footer = () => {
    return (

    <> 
        <section className="contact__section">

            <div className="contact__section--wrapper">
                <h2 className="contact__section__heading">Connect with us</h2>
                <div className="footer__icons">
                    <a className="footer__icons--icon" href="https://www.linkedin.com/in/thomas-mckyer/"><span className="label">LinkedIn</span><FontAwesomeIcon icon={['fab' , 'linkedin']} /></a>
                    <a className="footer__icons--icon divider" href="https://www.instagram.com/tmckyer/"><span className="label">Instagram</span><FontAwesomeIcon icon={['fab' , 'instagram']} /></a>
                    <a className="footer__icons--icon" href="https://github.com/tivler"><span className="label">Github</span><FontAwesomeIcon icon={['fab' , 'github-square']} /></a>
                </div>
            </div>


        </section>

        <footer className="footer">

            <nav className="footer__nav">
                <div className="footer__icons">
                    <a className="footer__icons--icon" href="https://www.linkedin.com/in/thomas-mckyer/"><FontAwesomeIcon icon={faPhoneAlt} /><span className="label">(704) 808 8000</span></a>
                    <a className="footer__icons--icon divider" href="https://www.instagram.com/tmckyer/"><FontAwesomeIcon icon={['fab' , 'instagram']} /><span className="label">information@slotify.io</span></a>
                    <a className="footer__icons--icon" href="https://github.com/tivler"><FontAwesomeIcon icon={['fab' , 'github-square']} /><span className="label">123 Somewhere Lit Drive, Charlotte, NC 28277</span></a>
                </div>
            </nav>

            <div className="copyright">
                <p className="copyright__text">Copyright &copy; 2019 Slotify.io</p>
            </div>
        </footer>
    </>

    )
}

export default Footer;
